import React,{Component} from 'react';
import Chart from 'react-google-charts';
import {Tables} from './exportfiles';

function PieChart() {
  const pieData = [
    ['Work', 11],
    ['Eat', 2],
    ['Commute', 2],
    ['Watch TV', 2],
    ['Sleep', 7],
  ]
  const pieOptions = {
  
    pieHole: 0.4,
  }
  return (
  <>
  <div className="col-md-5">
  <div className="mt-2">
       
        <Chart
          width={'500px'}
          height={'320px'}
          chartType="PieChart"
          loader={<div>Loading Chart</div>}
          data={pieData}
          options={pieOptions}
          rootProps={{ 'data-testid': '3' }}
        />
      </div>
  <Tables/>
  </div>
  </>
  );
}

export default PieChart;
